  bmlfReleaseRecord() {
    let parrHeaderData = [];
    if (this.mbBulkDelete == true) {
      this.maarraySelected.forEach(x => {
        parrHeaderData.push({
          AssemblyItemKey: x.Assembly_Item_Key,
          AssemblyLocation: x.Assembly_Location,
          RevisionNo: x.Assembly_Revision_No
        });
      });
    } else {
      parrHeaderData = [{
        AssemblyItemKey: this.mObjModel.Assembly_Item_Key,
        AssemblyLocation: this.mObjModel.Assembly_Location,
        RevisionNo: this.mObjModel.Assembly_Revision_No
      }];
    }
    let reqData = {
      JSON: JSON.stringify({
        HeaderData: parrHeaderData,
        Response: [{
          "ResponseText": "",
          "ErrorCode": ""
        }]
      })
    };
    this.bomEntryService.bmlfReleaseBOMRecord(reqData).subscribe(res => {
      if (res == null) {
        this.toastMessageService.notifyError(this.utilService.bmgfonTranslate('COMMON.MSG.SERVERERROR'));
        return false;
      }
      if (res.Response[0].ErrorCode == "") {
        {
          if (this.mbBulkDelete == true) {
            this.msMsgData.Data = res.Response[0].ResponseText;
            this.msMsgData.Header = this.utilService.bmgfonTranslate('COMMON.MSG.BATCHMASTER');
            this.msMsgData.mbBulkDeleteView = true;
            this.mbBulkDeleteView = true;
            this.maarraySelected = [];
          } else {
            if (res.Response[0].ResponseText.includes('exist') || res.Response[0].ResponseText.includes('Exists') || res.Response[0].ResponseText.includes('NEW')) {
              this.toastMessageService.notifyError(res.Response[0].ResponseText);
            } else {
              this.toastMessageService.notifySuccess(res.Response[0].ResponseText);
            }
          }
          this.mbBulkDelete = false;
          this.getDataList();
        }
      } else {
        this.toastMessageService.notifyError(res.Response[0].ResponseText);
      }
    });
  }
  bmlfonselectionChange(e) {
    if (e.selectedRows.length > 0) {
      e.selectedRows.forEach(ele => {
        this.maarraySelected.push(ele.dataItem);
      });
    } else if (e.deselectedRows.length > 0) {
      e.deselectedRows.forEach(ele => {
        let pobjTempData = ele.dataItem;
        this.maarraySelected = this.maarraySelected.filter(x => {
          if (x.Assembly_Item_Key != pobjTempData.Assembly_Item_Key || x.Assembly_Location != pobjTempData.Assembly_Location) {
            return x;
          }
        });
      });
    }
  }
