  //print single
  bmlfonPrintSDS(dataitem) {
    try {
      let pobjJData = [{
        PrintKey: dataitem.Assembly_Item_Key
      }];
      //change on 20July21 for Listing Variable -RD
      this.utilService.bmgfsdsPrint(pobjJData, this.msScreenName).then(value => {
        this.mbBulkPrint = false;
        this.getDataList();
      });
    } catch (e) {
      console.log('catch', e);
      console.log(e);
    }
  }
  //print multiple
  bmlfOnActionPrintSDS() {
    this.mbBulkPrint = true;
    let arrPrintKey = [];
    this.maarraySelected.forEach(ele => {
      arrPrintKey.push({
        PrintKey: ele.Assembly_Item_Key
      });
    });
    try {
      let printReqParam = arrPrintKey;
      this.utilService.bmgfsdsPrint(printReqParam, this.msScreenName).then(value => {
        this.maarraySelected = [];
        this.getDataList();
      });
    } catch (e) {
      console.log(e);
    }
  }
  //upload multiple
  bmlfonActionUpload() {
    let parrUploadData = [];
    this.maarraySelected.forEach(ele => {
      parrUploadData.push({
        "Assembly_Item_Key": ele.Assembly_Item_Key,
        "Assembly_Location": ele.Assembly_Location
      });
    });
    let pobjReqData = {
      JSON: JSON.stringify({
        ExESSPHPropMap: parrUploadData,
        Response: [{
          ResponseText: '',
          ErrorCode: ''
        }]
      })
    };
    this.bomEntryService.bmlfuploadBOM(pobjReqData).subscribe(res => {
      this.maarraySelected = [];
      this.getDataList();
      if (res.Response[0].ErrorCode == "") {
        this.msMsgData.Data = res.Response[0].ResponseText;
        this.msMsgData.Header = "BatchMaster";
        this.mbBulkDeleteView = true;
      } else {
        this.toastMessageService.notifyError(res.Response[0].ResponseText);
      }
    }, error => {
      console.log("in error");
    });
    // bmlfuploadItem
  }
