  //-------------------------------------------------------
  bmlfOnCreateBatch(dataitem) {
    //Begin 03/dec/2020 by deepak porwal for permission
    let mbWrite;
    let mbDelete;
    let objScreenPermission = JSON.parse(localStorage.getItem("BMEScreePermission"));
    let objPermission = objScreenPermission.filter(x => {
      if (x.MenuItem_Name == 'Batch Entry') {
        return x;
      }
    });
    if (objPermission.length > 0) {
      mbWrite = false;
      mbDelete = false;
      if (objPermission[0].Permission == "Write") {
        mbWrite = true;
      }
      if (objPermission[0].permission1 == "Delete") {
        mbDelete = true;
      }
      if (!mbWrite) {
        this.toastMessageService.notifyWarning(this.utilService.bmgfonTranslate('ADDSALESORDER.PERMISSION_WRITE'));
        return false;
      }
      ;
    } else if (objPermission.length == 0) {
      this.toastMessageService.notifyWarning(this.utilService.bmgfonTranslate('ADDSALESORDER.PERMISSION_WRITE'));
      return false;
    }
    //End 03/dec/2020 by deepak porwal for permission
    this.router.navigate(['/main/production/batch-entry/manage'], {
      queryParams: {
        FormulaID: dataitem.FormulaID
      },
      skipLocationChange: true
    });
  }
