  bmlfCheckQtyMaxLen(pobjFieldData, piIndex) {
    let setValue = typeof pobjFieldData == 'number' ? pobjFieldData.toString() : pobjFieldData;
    let QtyMaxLen = pobjFieldData % 1 != 0 ? this.mnumMaxLengthQty + this.miQtyPrecision : this.mnumMaxLengthQty;
    if (setValue.length > QtyMaxLen) {
      let prevValue = Number(setValue.substring(0, QtyMaxLen));
      this.marrItemDataList[piIndex]['DispReqQty'] = 0;
      setTimeout(() => {
        this.marrItemDataList[piIndex]['DispReqQty'] = prevValue;
      }, 1);
    }
  }
  /** change event of Item unit  */
  bmlfChangeItemUnitEvent(pnumIndex, pobjData) {
    let piOldQty = 0;
    let piMaterialCostQty = 0;
    let parrFilterUnitData = this.marrItemUnitList.filter(x => {
      if (x.ToKey == pobjData.DispUOM && x.Itemkey == pobjData.ItemKey) {
        return x;
      }
    });
    /** --- get unit conversation acc to old unit--- */
    let parrOldData = this.marrItemUnitList.filter(x => {
      if (x.ToKey == pobjData.OldUnit && x.Itemkey == pobjData.ItemKey) {
        return x;
      }
    });
    if (parrOldData.length > 0) {
      /**---- if  unit and old  unit is same */
      if (parrOldData[0].FromKey == pobjData.OldUnit) {
        piOldQty = pobjData.DispReqQty;
        piMaterialCostQty = pobjData.DispMatCost;
      } else {
        // if not same  then reverse unit conversation for achieve initial value
        if (parrOldData[0].Operation == "1") {
          piOldQty = this.utilService.bmgfSetPrecision(1 / parrOldData[0].convfctr * Number(pobjData.DispReqQty), this.miQtyPrecision);
          piMaterialCostQty = Number(pobjData.DispMatCost) > 0 ? this.utilService.bmgfSetPrecision(parrOldData[0].convfctr * Number(pobjData.DispMatCost), this.miCostPrecision) : this.utilService.bmgfSetPrecision(0, this.miCostPrecision);
        } else {
          piOldQty = this.utilService.bmgfSetPrecision(parrOldData[0].convfctr * Number(pobjData.DispReqQty), this.miQtyPrecision);
          piMaterialCostQty = Number(pobjData.DispMatCost) > 0 ? this.utilService.bmgfSetPrecision(1 / parrOldData[0].convfctr * Number(pobjData.DispMatCost), this.miCostPrecision) : this.utilService.bmgfSetPrecision(0, this.miCostPrecision);
        }
      }
    }
    if (parrFilterUnitData.length > 0) {
      if (parrFilterUnitData[0].Operation == "2") {
        this.marrItemDataList[pnumIndex].DispReqQty = 1 / parrFilterUnitData[0].convfctr * Number(piOldQty);
        this.marrItemDataList[pnumIndex].DispMatCost = this.utilService.bmgfSetPrecision(parrFilterUnitData[0].convfctr * Number(piMaterialCostQty), this.miCostPrecision);
        this.marrItemDataList[pnumIndex].InvConvFact = parrFilterUnitData[0].convfctr.toString();
      } else {
        this.marrItemDataList[pnumIndex].DispReqQty = parrFilterUnitData[0].convfctr * Number(piOldQty);
        this.marrItemDataList[pnumIndex].DispMatCost = this.utilService.bmgfSetPrecision(1 / parrFilterUnitData[0].convfctr * Number(piMaterialCostQty), this.miCostPrecision);
        // let toStr = (1 / parrFilterUnitData[0].convfctr).toFixed(3);
        let toStr = 1 / parrFilterUnitData[0].convfctr; // 182016
        this.marrItemDataList[pnumIndex].InvConvFact = toStr.toString();
      }
      this.marrItemDataList[pnumIndex].OldUnit = this.marrItemDataList[pnumIndex].DispUOM;
    }
  }
