  // So Footer Action finction
  bmlfFooterActionFn(event) {
    if (event == 'searchEvn') {
      if (this.mbIsChangeData || this.FieldExtender.mbChange == true || this.customCtrl.mbChange == true) {
        // if (!this.bmlfValidHeaderData()) {
        //     return;
        // }
        this.mbSaveDialogView = true;
        this.mbIsSearchMode = true;
        return false;
      }
      this.bmlfOpenLookupModal('BOMEntryList', this.msScreenName, 'BOMEntryList', 'click', '', 'custom', 'cmdSearch', 'BOM Entry');
    } else if (event == 'addEvn') {
      if (!this.utilService.mbWrite) {
        this.toastMessageService.notifyWarning(this.utilService.bmgfonTranslate('COMMON.PERMISSION_WRITE'));
        return false;
      }
      ;
      if (!this.bmlfValidHeaderData()) {
        return;
      }
      if (this.mbIsChangeData || this.FieldExtender.mbChange == true || this.customCtrl.mbChange == true) {
        this.mbSaveDialogView = true;
        this.mbIsAddMode = true;
        return false;
      }
      this.bmlfRefreshForm();
    } else if (event == 'deleteEvn') {
      if (!this.utilService.mbDelete) {
        this.toastMessageService.notifyWarning(this.utilService.bmgfonTranslate('COMMON.PERMISSION_DELETE'));
        return false;
      }
      ;
      if ((!this.mbIsChangeData || this.FieldExtender.mbChange == true || this.customCtrl.mbChange == true) && this.msItemKey == '' && this.msCopyRecord == "N") {
        this.toastMessageService.notifyWarning(this.utilService.bmgfonTranslate('COMMON.MSG.NODATADELETE'));
        return false;
      }
      if ((!this.mbIsChangeData || this.FieldExtender.mbChange == true || this.customCtrl.mbChange == true) && this.msCopyRecord == "Y") {
        this.bmlfRefreshForm();
        return false;
      }
      this.mbShowDeleteDialog = true;
    } else if (event == 'copyEvn') {
      if (!this.utilService.mbWrite) {
        this.toastMessageService.notifyWarning(this.utilService.bmgfonTranslate('COMMON.PERMISSION_WRITE'));
        return false;
      }
      ;
      // if (!this.bmlfValidHeaderData()) {
      //     return;
      // }
      if (src_app_core_services_custom_validators__WEBPACK_IMPORTED_MODULE_1__.CustomValidator.bmgfNullCheckValidator(this.mobjBOMEntryModel.AssemblyItemKey)) {
        this.bmlfOpenErrorBlock("COMMON.MSG.COPY");
        return;
      }
      if (this.mbIsChangeData || this.FieldExtender.mbChange == true || this.customCtrl.mbChange == true) {
        this.mbSaveDialogView = true;
        this.mbIsCopyMode = true;
        return false;
      }
      this.bmlfCopyData();
    }
  }
  bmlfOnConfirmModal(psype) {
    if (psype == 'YES') {
      this.bmlfSubmitData();
      this.mbSaveDialogView = false;
    } else if (psype == 'NO') {
      this.mbSaveDialogView = false;
      if (this.mbIsSearchMode) {
        this.mbIsSearchMode = false;
        this.bmlfOpenLookupModal('BOMEntryList', this.msScreenName, 'BOMEntryList', 'click', '', 'custom', 'cmdSearch', 'BOM Entry');
      } else if (this.mbIsAddMode) {
        this.mbIsAddMode = false;
        this.bmlfRefreshForm();
      } else if (this.mbIsCopyMode) {
        this.mbIsCopyMode = false;
        this.bmlfCopyData();
      } else if (this.mbIsDeleteMode) {
        this.mbIsDeleteMode = false;
        this.mbShowDeleteDialog = true;
      } else {
        this.router.navigate(['/main/bom/bomEntry']);
      }
    } else {
      this.mbSaveDialogView = false;
      this.mbIsSearchMode = false;
      this.mbIsCopyMode = false;
      this.mbIsAddMode = false;
      this.mbIsCloseMode = false;
    }
  }
