  // Delete Sales Order Dialog events
  bmlfonDialogAction(psAction) {
    if (psAction == 'No') {
      this.mbShowDeleteDialog = false;
    } else if (psAction == 'Yes') {
      if (this.msItemKey == '' || this.msItemKey != "" && this.msCopyRecord == "Y") {
        this.bmlfRefreshForm();
        return false;
      }
      let parrHeaderData = [];
      parrHeaderData = [{
        AssemblyItemKey: this.mobjBOMEntryModel.AssemblyItemKey,
        AssemblyLocation: this.mobjBOMEntryModel.AssemblyLocation,
        RevisionNo: this.mobjBOMEntryModel.RevisionNo
      }];
      let reqData = {
        JSON: JSON.stringify({
          HeaderData: parrHeaderData,
          Response: [{
            "ResponseText": "",
            "ErrorCode": ""
          }]
        })
      };
      this.bomEntryService.bmlfDeleteBOMRecord(reqData).subscribe(res => {
        if (res == null) {
          this.toastMessageService.notifyError(this.utilService.bmgfonTranslate('COMMON.MSG.SERVERERROR'));
          return false;
        }
        if (res.Response[0].ErrorCode == "") {
          {
            if (res.Response[0].ResponseText.includes('exist') || res.Response[0].ResponseText.includes('Exists')) {
              this.toastMessageService.notifyError(res.Response[0].ResponseText);
              this.mbShowDeleteDialog = false;
            } else {
              this.toastMessageService.notifySuccess(res.Response[0].ResponseText);
              this.mbShowDeleteDialog = false;
              let deleteKey = this.msScreenName + " — " + this.msItemKey;
              this.FieldExtender.bmgfDeleteData(deleteKey);
              this.bmlfRefreshForm();
            }
          }
        } else {
          this.toastMessageService.notifyError(res.Response[0].ResponseText);
          this.mbShowDeleteDialog = false;
        }
      });
    }
  }
