  bmlfChkBlankLine() {
    let isBlankLine = false;
    this.mArrContainerBomGrid1.some((pobjEle, piRowIdx) => {
      let rowNo = piRowIdx + 1;
      let psMsg = this.objUtils.bmgfonTranslate('CONTAINERBOMENTRY.COMPLETEROWENTRY') + ' ' + '(' + this.objUtils.bmgfonTranslate('COMMON.ROWNO') + rowNo + ')';
      //let psMsg = this.objUtils.bmgfonTranslate('CONTAINERBOMENTRY.KITITEMBLANK');
      if (pobjEle.LineName == 'Material' && pobjEle.ItemKey == '') {
        this.objToastService.notifyError(psMsg);
        isBlankLine = true;
        return false;
      } else if (pobjEle.LineName == 'Boilerplate' && pobjEle.ItemKey == '') {
        this.objToastService.notifyError(psMsg);
        isBlankLine = true;
        return false;
      }
    });
    return isBlankLine;
  }
