    if (!this.objUtils.mbWrite) {
      this.objToastService.notifyWarning(this.objUtils.bmgfonTranslate('COMMON.PERMISSION_WRITE'));
      return;
    }
    ;
    if (this.customGridCtrl != undefined) {
      if (!this.customGridCtrl.bmlfGlobalIsMandatory()) {
        return;
      }
    }
    let pbResult = this.bmlfonValidateFormDataSubmit();
    if (pbResult == false) {
      return;
    }
    if (!this.mbChange && !this.FieldExtender.mbChange && !this.customCtrl.mbChange) {
      return;
    }
    ;
    this.msCallFor = "Save";
    this.bmlfonSubmitData();
