  bmlfOpenLookupModal(psField, psScreenName, psLookUpKey, psEvent, psValue, psType, psEleId, pnumRowIdx = null) {
    this.mbIsLoading = true;
    this.marrLookupGridData = [];
    this.mobjLookupKeyData = {};
    if (psEvent == 'blur' && (psValue == undefined || psValue == '')) {
      this.mobjLookupDataModel[psField] = "";
      if (psField == "FormulaId") {
        this.msFormulaDesc = "";
      }
      return false;
    }
    let psReqData;
    if (psLookUpKey == "FGBOM") {
      if (psEvent == 'click') {
        this.mbChange = true;
      }
      psReqData = {
        "ScreenName": "CoProduct Formula/FInished Good Template",
        "LookUpKey": "FGBOM",
        "Filter1": this.mObjModel.FormulaID,
        "Filter2": this.mObjModel.TemplateKey,
        "Filter3": "",
        "Filter4": "",
        "Filter5": ""
      };
    } else if (psLookUpKey == "ShowAllFGBOM") {
      psReqData = {
        "ScreenName": "CoProduct Formula/FInished Good Template",
        "LookUpKey": "ShowAllFGBOM",
        "Filter1": this.mObjModel.TemplateKey,
        "Filter2": "",
        "Filter3": "",
        "Filter4": "",
        "Filter5": ""
      };
    } else if (psLookUpKey == "FormulaId") {
      if (psEvent == 'click') {
        this.mbChange = true;
      }
      psReqData = {
        "ScreenName": "CoProduct Formula/FInished Good Template",
        "LookUpKey": "FormulaId",
        "Filter1": "",
        "Filter2": "",
        "Filter3": "",
        "Filter4": "",
        "Filter5": ""
      };
    } else if (psLookUpKey == "HeaderLookup") {
      psReqData = {
        "ScreenName": "CoProduct Formula/FInished Good Template",
        "LookUpKey": "CoProductList",
        "Filter1": "",
        "Filter2": "",
        "Filter3": "",
        "Filter4": "",
        "Filter5": ""
      };
    }
    ;
    this.objLookupService.getLookup(psReqData).subscribe(res => {
      this.mbIsLoading = false;
      if (res == null) {
        this.bmlfOpenErrorBlock('COMMON.MSG.NODATA');
        return false;
      }
      let obj1 = {};
      if (Object.entries(res).length > 0 && res.LookupData.length > 0) {
        let psLookupHeading = psField;
        if (psField == "FormulaId") {
          psLookupHeading = "Formula Lookup";
          res.LookupData.forEach(ele => {
            ele.RevisionDate = moment__WEBPACK_IMPORTED_MODULE_1__(ele.RevisionDate).format(this.msCustomDateFormat.toUpperCase());
            ele.RevisionTime = new Date(ele.RevisionTime).toLocaleTimeString();
          });
        }
        ;
        if (psField == "FGBOM" || psField == "ShowAllFGBOM") {
          psLookupHeading = "Finished Good Lookup";
        }
        ;
        if (psLookUpKey == "HeaderLookup") {
          psLookupHeading = "HeaderLookup";
          res.LookupData.forEach(ele => {
            ele.RecDate = moment__WEBPACK_IMPORTED_MODULE_1__(ele.RecDate).format(this.msCustomDateFormat.toUpperCase());
          });
        }
        this.marrLookupGridData = res.LookupData;
        this.mnumLineItemRowIndex = pnumRowIdx;
        this.mobjLookupKeyData.field = psLookupHeading;
        this.mobjLookupKeyData.gridData = this.marrLookupGridData;
        this.mobjLookupKeyData.type = psType;
        this.mobjLookupKeyData.eleId = psEleId;
        if (psLookUpKey == "HeaderLookup") {
          this.mobjLookupKeyData.title = "CoProduct Entry Lookup";
        }
        if (psValue) {
          this.mobjLookupKeyData.searchValue = psValue;
        } else {
          this.mobjLookupKeyData.searchValue = '';
        }
        if (psEvent == 'blur' && psValue) {
          let parrFilterdArr = [];
          /** --- Check : enter key matching record found. if find single row then direct call save lookup function --*/
          let pobjFirstInput = Object.keys(this.marrLookupGridData[0])[0];
          parrFilterdArr = this.marrLookupGridData.filter(obj => {
            if (String(obj[pobjFirstInput]).toUpperCase() == String(psValue).toUpperCase()) {
              return obj;
            }
          });
          if (parrFilterdArr.length == 1) {
            this.mobjLookupKeyData.value = parrFilterdArr[0];
            this.mobjLookupKeyData.valueKey = parrFilterdArr[0][pobjFirstInput];
            this.bmlfSaveLookupField(this.mobjLookupKeyData);
            this.mbIsLookupModal = false;
          } else {
            this.mbIsLookupModal = true;
          }
        } else if (psEvent == 'click') {
          this.mbIsLookupModal = true;
        }
      } else {
        this.bmlfOpenErrorBlock('COMMON.MSG.NODATA');
      }
    }, err => {
      console.log(err);
      this.mbIsLoading = false;
    });
  }
  bmlfOpenErrorBlock(psMsg) {
    this.objToastService.notifyWarning(this.objUtils.bmgfonTranslate(psMsg));
  }
  bmlfSaveLookupField(pobjEvent) {
    this.mbIsLookupModal = false;
    this.mbChange = true;
    if (pobjEvent.field == "Formula Lookup") {
      this.msFormulaDesc = pobjEvent.value["Description"];
      this.mObjModel.FormulaID = pobjEvent.valueKey.trim();
    }
    if (pobjEvent.field == "Finished Good Lookup") {
      var parrFilterData;
      this.mnumLineItemRowIndex = this.mArrCoProductFormulaGrid1.length + 1;
      const pobjDataCopy = Object.assign({}, this.mObjModelGrid1);
      pobjDataCopy.TemplateKey = this.mObjModel.TemplateKey.trim();
      pobjDataCopy.ItemKey = pobjEvent.valueKey.trim();
      pobjDataCopy.Description = pobjEvent.value["DESC1"];
      pobjDataCopy.Location = pobjEvent.value["ASSEMBLY_LOCATION"];
      pobjDataCopy.UOM = pobjEvent.value["BOMUOM"];
      pobjDataCopy.Quantity = 0;
      pobjDataCopy.RecUserID = this.msRecUserID;
      pobjDataCopy.Spare = "A";
      this.mArrCoProductFormulaGrid1.push(pobjDataCopy);
      if (this.mArrCoProductFormulaGrid1.length > 0) {
        parrFilterData = this.mArrCoProductFormulaGrid1.filter(obj => obj['ItemKey'].toUpperCase() == pobjEvent.valueKey.trim().toUpperCase());
      }
      if (parrFilterData.length == 0) {
        let lastRowIdx = this.mArrCoProductFormulaGrid1.length - 1;
        let tableElement = document.getElementById("kendodiv");
        setTimeout(() => {
          let rowElement = tableElement.getElementsByTagName('tr');
          let tdElement = rowElement[lastRowIdx + 1].getElementsByTagName('td');
          console.log(tdElement);
          let fromElement = tdElement[0].getElementsByTagName('input');
          fromElement[0].focus();
        }, 100);
      } else if (parrFilterData.length == 2) {
        let str = this.mArrCoProductFormulaGrid1.splice(this.mnumLineItemRowIndex - 1, 1);
        this.objToastService.notifyError('Srno' + ' - ' + [this.mnumLineItemRowIndex - 1] + ' ' + this.objUtils.bmgfonTranslate('COPRODUCTFORMULA.DuplicateRows'));
        return false;
      }
    }
    if (pobjEvent.field == "HeaderLookup") {
      this.msKey = pobjEvent.valueKey.trim();
      let jsonObj = {
        TemplateKey: this.msKey
      };
      this.objUtils.refreshUrlAndInitCustom('/main/bom/refresh', '/main/bom/coproductformulafinishedgood/manage', true, jsonObj);
      this.msCopyRecord = 'N';
      this.bmlfGetDataOnLoad(this.msKey, '');
    }
    if (pobjEvent.field.toLowerCase().includes('custom') || pobjEvent.field.toLowerCase().includes('user')) {
      if (this.msLookupCallFor == "dtSalesKit") {
        this.mArrCoProductFormulaGrid1[this.mnumLineItemRowIndex][pobjEvent.field] = pobjEvent.valueKey.trim();
        this.mArrCoProductFormulaGrid1[this.mnumLineItemRowIndex].Spare = "M";
      }
      this.mbChange = true;
      return;
    }
  }
